Top 5: Dark circle creams that actually work!
Welcome to Ep 01 of another ongoing series - ‘Top Products’ where I’m rounding up the best of the best in every category!

First let’s get something straight.. there is NO eye cream that will magically disappear your dark circles - especially if they’re genetic or due to thinned skin or hollow under eyes. But they can help reduce superficial dark circles and prevent them from getting worse as well as hydrate the area to prevent wrinkles and further thinning of the skin. So keeping that in mind - these are the absolute best eye creams I’ve found that do actually work. They’re all a bit of a splurge but they last very long and personally I feel they’re all worth it!

@beautyofjoseon_official Revive Eye Serum
@caudalieindia Vinoperfect Brightening Eye Cream
@vtcosmetics_india Reedle Shot Eye Cream
@wishfulskin Eye Lift & Contour
@kiehlsindia Creamy Eye Treatment
